public void computeFixedPoint(DiGraph<N, E> graph) {
    Set<N> nodes = Sets.newHashSet();
    for (DiGraphNode<N, E> node : graph.getDirectedGraphNodes()) {
      nodes.add(node.getValue());
    }
    computeFixedPoint(graph, nodes);
  }
